import Head from "next/head";
import { useEffect } from "react";

function About() {
	useEffect(() => {
		document.title = "NOTHING HERE";
	}, []);
	return (
		<div>
			<Head>
				<title>About Next</title>
			</Head>
			About
			<style jsx>{`
				div {
					color: red;
					background-color: pink;
					padding: 50px;
				}
			`}</style>
			;
		</div>
	);
}

export default About;
